import React, { Component } from "react";
import "./Projects.css";

class Projects extends Component {
  render() {
    return (
      <div className="projectMain">
        {/* <div className="projectContainer"> */}
        <div className="sidebar">
          <button className="projectHeader">My Projects</button>
          <ul>
            <li>
              <button className="sideName" id="anagram">
                Anagram Generator
              </button>
            </li>
            <li>
              <button className="sideName" id="proof">
                Proof Technology Webpage
              </button>
            </li>
          </ul>
        </div>
        <div className="mainItem">
          <div className="itemImage">test</div>
        </div>
      </div>
    );
  }
}
export default Projects;
